import React from "react";
import map from "../public/static/images/themap.jpg";

export const Contact = props => {
  return (
    <section id="Contact">
      <div className="container">
        <div className="map-and-contact">
          <h5 className="comp-title">Contact</h5>
          <div className="box">
            <div className="row">
              <div className="col-md-6">TWO</div>
              <div className="col-md-6">ONE</div>
            </div>
          </div>
          <img className="map" src={map} />{" "}
        </div>
      </div>
    </section>
  );
};

export default Contact;
